        super(props);
        this.state ={
        }
    }


  render() {
        return (
            <div>
            This is Header
            <Icon name='home' size='mini' />
            <div><i aria-hidden="true" class="home mini icon"></i><i aria-hidden="true" class="home tiny icon"></i><i aria-hidden="true" class="home small icon"></i><i aria-hidden="true" class="home small icon"></i><br/><i aria-hidden="true" class="home icon"></i><br/><i aria-hidden="true" class="home large icon"></i><br/><i aria-hidden="true" class="home big icon"></i><br/><i aria-hidden="true" class="home huge icon"></i><br/><i aria-hidden="true" class="home massive icon"></i></div>
            <IconGroup/>
            </div>
        );
    }
}

export default HeaderComponent;
